import math

def calculate_max_spending(L, A, N, D):

    def total(g):
        if g <= 0:
            return 0
        first = N - g * (D - 2) - 1
        f = (L - first) // g
        if first < g or A - f <= 0 or first + g * (A - 1) < L:
            return 0
        partial = int((2 * (A - 1) - f + 1) / 2 * f)
        left = (A - f - 1) * (-f * g + L - first)
        return first * A + partial * g + left
    if D == 1:
        return L * A
    if D == 2:
        n1 = N - 1
        if n1 * A >= L:
            ln1 = L // n1
            return int((-2 * A + 1 - ln1) / 2 * ln1 * n1) + (A - ln1) * (L - ln1 * n1)
